import axios from "axios";
import React, { useEffect, useState } from "react";
import {
  GStockContainer,
  Wrapper,
  TableTh,
  GStockTable,
  ProductImg,
} from "./GstockElements.js";

const Gstock = () => {
  const [Products, setProducts] = useState([]);
  const [Compteur, setCompteur] = useState(0);
  useEffect(() => {
    axios
      .get("https://productsapi1.herokuapp.com/api/produits")
      .then((Response) => {
        setProducts(Response.data);
        console.log(Products);
      })
      .catch((error) => {});
  }, [Products]);
  return (
    <div>
      <Wrapper>
        <GStockContainer>
          <GStockTable>
            <tr>
              <TableTh>Num Produits</TableTh>
              <TableTh>Nom</TableTh>
              <TableTh>Prix</TableTh>
              <TableTh>Image</TableTh>
              <TableTh>quantite</TableTh>
              <TableTh>Ã©tat</TableTh>
            </tr>
            {Products.map((product) => {
              return (
                <tr>
                  <td>{Compteur}</td>
                  <td>{product.nom}</td>
                  <td>{product.prix}</td>
                  <td>
                    <img></img>
                    {product.nom}
                  </td>
                  <td>{product.nom}</td>
                  <td>{product.nom}</td>
                </tr>
              );
            })}
          </GStockTable>
        </GStockContainer>
      </Wrapper>
    </div>
  );
};

export default Gstock;
